import React from 'react'
import styled from 'styled-components'

const Container=styled.div`
position: absolute;
width: 1512px;
height: 6723px;
left: 0px;
top: 1287.5px;`

const Div1=styled.div`
display: flex;
flex-direction: row;
align-items: flex-start;
padding: 96px 196px;
position: absolute;
width: 1512px;
height: 352px;
left: 0px;
top: 0px;
background: #FFFFFF;`

const Data=styled.div`
display: flex;
flex-direction: row;
align-items: flex-start;
padding: 0px;
gap: 32px;

width: 1120px;
height: 160px;


`

const Info = () => {
  return (
    <Container>
      <Div1>
        <Data></Data>
      </Div1>
    </Container>
  )
}

export default Info
